import React from 'react';
import '../App.css';

function About() {
    return (
      <div className="mainDiv">
        <div className="divContent" >
            <p className="customP">02. Talents</p>
            <h1>About me</h1>
            <div className="paragraph">
              <p>I am constantly concerned about how to improve personally and as a professional, to acquire new skills. </p>
              <p>&#10032; Technology enthusiast.</p>  
              <p>Lover of the Renaissance era.</p>
              <p>#CSS favorite colors: deeppink, lightsalmon, lightseagreen</p>
              <p>Current time zone: CEST/UTC+2</p>
            </div>
        </div>
        <div className="divContentRight">
        <h2>&#9734; Technologies:</h2>
            <p><span className="customP"> React.JS  |  Javascript   |  HTML5  |  CSS3 | Firebase |  Photoshop | Figma</span></p>
            </div>
      </div>
    );
  }
  
  export default About;
